import React, { useEffect } from 'react';
import { useParams } from 'react-router-dom';

function BookingPage() {
  const { id } = useParams();

  useEffect(() => {
    // Fetch show details again or use the stored details from local storage
    // ...

    // Assuming 'userDetails' is an object with user information
    const userDetails = JSON.parse(localStorage.getItem('userDetails'));

    // You can now use userDetails to pre-fill the form fields
    console.log('Pre-filled movie name:', id);
    console.log('User details:', userDetails);
  }, [id]);

  return (
    <div className="container">
      <h1>Booking Page</h1>
      {/* Include your booking form component here */}
    </div>
  );
}

export default BookingPage;
